import { defineStore } from 'pinia';

import UserStuff from "~constants/userStuff";
import StoreStuff from "~constants/userStuff";

interface Stuff {
  id: number,
  name: string,
}

export const useStuffList = defineStore('useStuffList', {
  state: () => {
    return {
      userStuff: [] as Stuff[],
      storeStuff: [] as Stuff[],
    }
  },
  getters: {
    userStuff: (state) => state.userStuff,
    storeStuff: (state) => state.storeStuff,
  },
  actions: {
    fetchData() {
      this.userStuff = UserStuff;
      this.storeStuff = StoreStuff;
    },
  },
})
